Hi Misty & All,

I use the denoiser at times but sometimes it changes it so much or makes
it robotic sounding. I usually try it just to see if it cleans it up
nicely or if it distorts it.

On another note I also like Sony Sound Forge Audio Studio because it has
a really nice time stretch in that does not skew:
http://www.sonymediasoftware.com/Products/ShowProduct.asp?PID=975
&lt;http://www.sonymediasoftware.com/Products/ShowProduct.asp?PID=975&Versi
on=7.0&Build=301&Lang=ENU&Locale=0&gt;
&Version=7.0&Build=301&Lang=ENU&Locale=0

You can download a free trial of it I think it&#39;s probably good for 30
days. 

Andrea

-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Misty Dawn
Sent: Monday, July 10, 2006 2:05 PM
To: Amy Swanson; EVP-ITC@yahoogroups.com
Subject: Re: Amy Re: [EVP-ITC] evp bit

Your welcome. You dont need a class Amy. I know how frustrating it can
be. When I first started the others would help me too. Then &quot;they&quot; sent
me on a wild goose chase one day sending me a message for someone in the
group and said give this to Paul. I sent it, he only heard static. So I
used a new program I had just run across called clear voice denoiser and
in the process of playing with his file I found some settings which
solved all of my cleaning up problems. Plus it uncovered other voices I
couldnt hear before. Thus the &quot;paul&quot; filter was born

I would literally get headaches at the end of all of my sessions by
trying to figure out how to clean them. Once I lucked upon the right
filters, havent had a headache since. They also gave some hints for what
settings to use a few times but I didnt understand what they meant until
later.


To get ya started heres the paul filter. I usually set it u! nder
options to amplify X 15.

I am also sending some of the other filters (paul2 paul3 mistyxx)
because after they had me play with some settings I realized sometimes
those multilayer voices have other voices you cant hear underneath them.
Just download them and save them then once you have clear voice denoiser
installed just stick them in the denoiser folder with the rest of its
filters. You will then be able to use them once you start the program it
will list them under &quot;professional&quot; when you click that button.

Alot of people dont think using filters is good. They want all of thier
evp&#39;s to be &quot;class A&quot; or they wont even bother with it. I on the other
hand never go for the class A type, even tho now and then I get them and
I am happy to have gotten it, I use the system I set up with those on
the other side as the &quot;norm&quot; because they go by these guidelines now
too. I still only record for 30 seconds which is just right for the demo
of Clear Voice. And they pack alot into that 30 seconds so the
multilayers are at different speeds now rather than they all talk at
once I slow it down to -74 in audacity to hear some of my groups
messages. I also asked them to speak one at a time and they now try and
do that rather than a room full of people all speaking at once.

I know this was a private email, but only because it was too large to
send all the files to group. I am now sharing the filter part with the
group in case anyone else wants them.

Misty
Amy Swanson &lt;lon3_s7ar@...&gt; wrote:
thank you!!! !!!! !!!!!
some of them sound like the dryer just clanking, others sound as
authentic voices. I really need to find some sort of class on how to
make these batter for me to hear, my way isnt really working at all

thank you lots!!! i know taht takes some time to do !


amy

Misty Dawn &lt;bulletbabea@...&gt; wrote:
Amy,

It would have been easier with the original file LOL I dont know what ya
did to it or how good these results will be but heres a buncha stuff i
pulled from it after i had to cut it in 3 sections to try and work on it
LOL

Hope these help ya Amy, and you should start with the original CLR files
and then work your way down thru the messages.

Misty

Amy Swanson &lt;lon3_s7ar@...&gt; wrote:
Frank or anyone available?
Can you clean this up? When i clean it up i can hear something, but not
getting it to where i want it! The background noise is A. me breathing
B. A pair of jeans clanging in the dryer! lol


amy

